"use strict";new Vue({el:"#app",data:{table:null},mounted:function(){var e=this;axios.get("/systemParameter/data_get").then(function(a){var t=JSON.parse(a.data.data);e.table=t}).catch(function(e){console.log("err",e)})},methods:{save:function(){var e=this;axios.post("/systemParameter/data_save",e.table).then(function(a){console.log(a),a.data.status?e.$message({type:"success",message:a.data.message}):e.$message({type:"error",message:a.data.message})}).catch(function(e){console.log("err",e)})}}});